function [outputImage] = SimDoNothingOnImage(inputImage,camera)% [outputImage] = SimDoNothingOnImage(inputImage,camera)%% Dummy routine for use as a placeholder in% simulation pipelines.  Just passes the% image on through.%% 10/29/98  dhb  Added comments.% 1/15/99   dhb  Take camera argument as well.% Copyright (c) 1999 David Brainard and Philippe Longere.   All rights reserved.% Check usageif ( nargin ~= 2 )  error(['SimDoNothingOnImage(inputImage,camera)']);end% Read the image and pass it through.if (isstruct(inputImage))  outputImage = inputImage;else  outputImage = SimReadImage(inputImage); end